import React from 'react';
import { Button, Grid } from '@material-ui/core';
import {
  createStyles,
  withStyles,
  makeStyles,
  Theme,
  ThemeProvider,
} from '@material-ui/core/styles';
import './Header.css';
import Toolbar from '@material-ui/core/Toolbar';
import AppBar from '@material-ui/core/AppBar';
import Typography from '@material-ui/core/Typography';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';


const ColorButton = withStyles((theme) => ({
  root: {
    color: "white",
    backgroundColor: "black",
    '&:hover': {
      backgroundColor: "black",
    },
    margin: "10px",
  },
}))(Button);

export default function Header() {
    return (
      // <Toolbar className="toolbar">
      //   <Grid container alignItems="center" justify="flex-start">
      //       <img src="/images/MathLaw.PNG"></img>
      //       <img src="/images/logo.PNG" style={{marginBottom: "33px", marginLeft: "30px"}}></img>
      //   </Grid>
      //   <Grid container alignItems="center" xs={12} justify="flex-end">
      //     <Grid><ColorButton>Sign Up</ColorButton></Grid>
      //     <Grid><ColorButton>Log In</ColorButton></Grid>
      //   </Grid>
      // </Toolbar>
      <div>
      <AppBar position="static">
        <Toolbar>
          <IconButton edge="start" color="inherit" aria-label="menu">
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" >
            News
          </Typography>
          <ColorButton color="inter">Login</ColorButton>
          <ColorButton>Sign Up</ColorButton>
        </Toolbar>
      </AppBar>
    </div>

    );
}
